class Solution1871 {

	private String str;
	private int minJump, maxJump;
	private boolean[] checkCache;

    public boolean canReach(String s, int minJump, int maxJump) {
    	//special case 
    	if (s.charAt(s.length()-1) != '0') {
    		return false;
    	}//fi
    	
    	this.str = s;
    	this.minJump = minJump;
    	this.maxJump = maxJump;
    	this.checkCache = new boolean[str.length()];
        return search(0+minJump, 0+maxJump);
    }//end method

    /**
     * precondition:
     * - it is assumed that fromInx =< toInx
     * the following data have to be available and be valid
     * - string to be processed
     * - minimum jump number
     * - maximum jump number
     * @param fromInx - int the index number it is to be scanned from
     * @param toInx -int the index number it is to be scanned to
     * @return true if it can jump to last position
     */
    private boolean search(int fromInx, int toInx) {
    	//base cases
    	if (fromInx >= str.length()) {
    		return false;
    	} else if (toInx >= str.length()-1) {
    		return true;
    	}//fi
    	
    	boolean res = false;
    	int nextToInx = Integer.MAX_VALUE;
    	int nextFromInx = Integer.MAX_VALUE;
    	int currInx;
    	    	
    	for (currInx = toInx; currInx >= fromInx && !res && nextFromInx != toInx+1; currInx--) {
    		if (checkCache[currInx]) {
    			continue;
    		} else {
    			checkCache[currInx] = true;
    		}//fi
    		if (str.charAt(currInx) != '0') {
    			continue;
    		} else {
    			nextToInx = Math.min(nextFromInx-1, currInx+maxJump);
    			nextFromInx = Math.max(toInx+1, currInx+minJump);
    			res |= search(nextFromInx, nextToInx);
    		}//fi
    	}//rof   	
		return res;
    }//end method   
}//end class

class Solution1871_v1 {

	private Boolean[] traverseStatusArr;
	private String str;
	private int minJump, maxJump;

    public boolean canReach(String s, int minJump, int maxJump) {
    	//special case 
    	if (s.charAt(s.length()-1) != '0') {
    		return false;
    	}//fi
    	
    	this.traverseStatusArr = new Boolean[s.length()+maxJump];
    	traverseStatusArr[s.length()-1] = true;
    	this.str = s;
    	this.minJump = minJump;
    	this.maxJump = maxJump;
    	
        return search(0);
    }//end method
    
 
    
    /**
     * precondition:
     * the following data have to be available and be valid
     * - string to be processed
     * - traverse status array
     * - minimum jump number
     * - maximum jump number
     * @param currInx - int the index number it is to be processed
     * @return true if it can jump to last position
     */
    private boolean search(int currInx) {
    	if (traverseStatusArr[currInx] != null) {
    		return traverseStatusArr[currInx];
    	}//fi
    	
    	///base cases
    	if (//currInx >= str.length()||
    		str.charAt(currInx) != '0'
    		) {
    		traverseStatusArr[currInx] = false;
    		return traverseStatusArr[currInx];
    	}//fi
    	
    	boolean tmpRes = false;
    	int maxInx = Math.min(str.length()-1, currInx+maxJump);
    	int minInx = currInx+minJump;
    	//int nextInx;
    	//for (int nextInx = Math.min(str.length()-1, currInx+maxJump); nextInx >= currInx+minJump && !tmpRes; nextInx--) {
    	for (int nextInx = maxInx; nextInx >= minInx && !tmpRes; nextInx--) {
    		tmpRes |= search(nextInx);
    	}//rof

		traverseStatusArr[currInx] = tmpRes;
		return traverseStatusArr[currInx];
    }//end method   
}//end class
